sections.code:
div.is-row-header {
    width:500px !important;
}

.azc-grid-area {
    width:100% !important;
}
.azc-grid-container .azc-grid-tableContainer table {
    width:100% !important;
    max-width:1500px !important;
}
div.ext-wizardStepWidth {
    max-width:2500px !important;
}

div.fxc-weave-pccontrol div.fxc-gc-thead {
    background: #f7f7f7;
}

div.fxc-gc-row:nth-child(odd) {
    background:#a7c4f21a;
}
div.fxc-gc-row a {
    color:#00004f;
    font-weight:bold;
}
/* Header - Name */
div.fxc-weave-pccontrol div.fxc-gc-columnheaderrow div.fxc-gc-columnheader:first-child {
    width:850px;
    background:#f7f7f7;
}

/* Header - Description */
div.fxc-weave-pccontrol div.fxc-gc-columnheaderrow div.fxc-gc-columnheader:nth-child(2) {
    width:200px;
    background:#f7f7f7;

}
/* Header - OMA-URI */
div.fxc-weave-pccontrol div.fxc-gc-columnheaderrow div.fxc-gc-columnheader:nth-child(3) {
    width:900px;
    background:#f7f7f7;
}
/* Header - Value */
div.fxc-weave-pccontrol div.fxc-gc-columnheaderrow div.fxc-gc-columnheader:nth-child(4) {
    width:100px;
    background:#f7f7f7;
}
/* Header - Menu */
div.fxc-weave-pccontrol div.fxc-gc-columnheaderrow div.fxc-gc-margincolumnheader-contextmenu  {
    width:150px;
    background:#f7f7f7;
}


/* Name */
div.fxc-weave-pccontrol div.fxc-gc-row-content .fxc-gc-cell:first-child {
    color:#000;
    font-family:"Bahnschrift" !important;
    width:850px;
    background-size:10px !important;
}

/* Description */
div.fxc-weave-pccontrol div.fxc-gc-row-content .fxc-gc-cell:nth-child(2) {
    font-size:0.9em;
    color:#9b0000;
    width:200px;
}

/* OMA-URI */
div.fxc-weave-pccontrol div.fxc-gc-row-content .fxc-gc-cell:nth-child(3) {
    font-family:"Bahnschrift" !important;
    width:900px;
}

/* Value */
div.fxc-weave-pccontrol div.fxc-gc-row-content .fxc-gc-cell:nth-child(4) {
    color:#9b0000;
    width:150px;
}
